function Login() {

  /*const history = useHistory();
  const [modalIsOpen,setIsOpen] = useState(false);
  const [buttonString,setButtonString] = useState("");*/

  function JumpRedirect(page){
       
    setButtonString(page)
    setIsOpen(true);
}
  function Redirect(page){

    history.push("/"+page);
    return <Redirect    to={{
      pathname:'/'+page
        }}/>
  }

  return (
    <div className="Home">
      <div className="Top">
        <div>
          <button className="button button1">צור קשר</button>
          <button className="button button1">אודות</button>
        </div>
        <div>
         <img src={logo} alt="Logo"/>
        </div>
      </div>
      <div className="login" >
        <p staly={{marginBottom: '30px'}}>PartnerTAU ברוכים הבאים לאתר</p>
        <div><input type ="text"></input>שם משתמש</div>
        <div><input type ="text"  style={{marginBottom: '30px'}}></input>סיסמה</div>
        <div className="Row">
          <button className="button button1">שכחתי סיסמה</button>
          <button className="button button1">הירשם</button>
          <button className="button button1">התחבר</button>
        </div>
      </div>
      <button className="button button1">התחבר באמצעות גוגל</button>
      <Modal
          isOpen={modalIsOpen}
          style={customStyles}
          contentLabel="Example Modal"
        >
        </Modal>
    </div>
  );
}

export default Login;
